import React from 'react';
import { Link } from 'react-router-dom';
import {Navbar, Links, App} from './styles/navbar.style.js';

const NavBar = () => {
  return (
    <App>
    <Navbar>
      <Links>
        <Link to="/">Home</Link>
        <Link to="/login">Login</Link >
        <Link to="/faq">Faq</Link >
        <Link to="/about">About Us</Link >
        <Contact><Link to="/contact">Contact Us</Link ></Contact>
      </Links>
      </Navbar>
      </App>
  );
}
export default NavBar;
